const [idregion, setIdRegion] = useState (-1);
return(
<div className="row">
    <div className="col-6">
<h3>Regiones</h3>
<select name="region" id="selRegion">
{
    Region.map(item,)
}
</select>

    </div>

</div>
)
}
export default Definitivo
